import { autorun } from 'mobx';
import localStorage from 'mobx-localstorage';

autorun(() => {
  if(localStorage.getItem('foo')){
    console.log(localStorage.getItem('foo'));
  }

});



const Favorites = () => (
    <div className="container">
        <h1>Favorites Page</h1>
    </div>
);

export default Favorites;
